import { useServerRequest } from "../../hooks"; 
import { useState } from "react";

import { useEffect } from "react";
import styled from "styled-components";


const MenuContainer = ({ className }) => {

    const [errorMessage, setErrorMessage] = useState(null);
    const [menuItems, setMenuItems] = useState(null);
    const requestServer = useServerRequest();
    console.log(requestServer)

    useEffect(() => {
        // Promise.all([
        //     requestServer('fetchMenu'), 

        // ]).then((menuRes) => {
            requestServer('fetchMenu').then((menuRes) => {
            console.log('in menu menuRes =', menuRes);
            if (menuRes.error) {
                console.log(`in menu menuRes = ${menuRes.error} errorMessage = ${menuRes.errorMessage}`);
                setErrorMessage(menuRes.error);
                return;
            };
            setMenuItems(menuRes.res);


        });

    }, [requestServer]);




    return (
        <div className={className}>
            {/* <Content error={errorMessage}> */}
            <h2>Пользователи</h2>
            {console.log('in MenuContainer menuItems = ', menuItems)}
            {menuItems ?
            <div>
                In div
                {menuItems.map(( id, menu_item) => (
                    <div key={id}>{menu_item}</div>

                ))}  

            </div>
            : <>Пусто</> 
                }   
            {/* </Content> */}

        </div>    
    );

}

export const Menu = styled(MenuContainer)`
    display:    flex;
    flex-direction: column;  
    align-items:   center;
    margin: 0   auto;
    width:  570px;
    front-size: 18px;

`;
